// @ts-ignore
import analyze from 'rgbaster';

onmessage = e => {
  console.log('Worker received:', e.data);
  if (process.browser) {
    analyze(e.data)
      .then(value => {
        if (value[0]) {
          // @ts-ignore
          postMessage(value[0]);
        }
      })
      .catch(err => console.log(err));
    console.log('I am on browser');
  }
};
